import React from "react";

export default function cocktailsList({ drinks }) {
  return (
    <div class="pure-g">
      {drinks.map(({ strDrinkThumb, strDrink, strIBA, strAlcoholic }) => (
        <div className="pure-u-1 pure-u-md-1-3">
          <div className={strDrink}>
            <img src={strDrinkThumb} />
            {strDrink}
            <br />
            {strIBA}
            <br />
            {strAlcoholic}
          </div>

          <button class="pure-button pure-button-primary">Add to Cart</button>
        </div>
      ))}
    </div>
  );
}
